import usb.core
import usb.util

def send_and_read(dev, data, label=""):
    try:
        bytes_sent = dev.write(EP_OUT.bEndpointAddress, data, timeout=5000)
        print(f"[{label}] Sent {bytes_sent} bytes.")

        # Read the response
        read_size = EP_IN.wMaxPacketSize
        response = dev.read(EP_IN.bEndpointAddress, read_size, timeout=5000)
        print(f"[{label}] IN response ({len(response)} bytes): {bytes(response).hex()}")

    except usb.core.USBError as e:
        print(f"[{label}] USBError: {e}")

def find_endpoints(dev):
    global EP_OUT, EP_IN
    cfg = dev.get_active_configuration()
    for intf in cfg:
        for ep in intf:
            if usb.util.endpoint_type(ep.bmAttributes) == usb.util.ENDPOINT_TYPE_BULK:
                direction = usb.util.endpoint_direction(ep.bEndpointAddress)
                if direction == usb.util.ENDPOINT_OUT:
                    EP_OUT = ep
                elif direction == usb.util.ENDPOINT_IN:
                    EP_IN = ep

# Find the device
dev = usb.core.find(idVendor=0x87ad, idProduct=0x70db)
if dev is None:
    raise ValueError("Device not found")

dev.set_configuration()
EP_OUT, EP_IN = None, None
find_endpoints(dev)

# Packet 1 (with header and partial payload)
